//fix
window.jsPDF = window.jspdf.jsPDF;

window.addEventListener("load", function () {
  const currentDate = new Date();
  const year = currentDate.getFullYear();
  const month = currentDate.getMonth() + 1;
  const day = currentDate.getDate();

  let fecha = document.querySelector(".fecha");
  fecha.innerHTML = `${day}/${month}/${year}`;
});

function logoConmenas() {
  return "data:image/png;base64,";
}

function generarTR() {
  let newRow = document.createElement("tr");
  let newCell1 = document.createElement("td");
  let newCell2 = document.createElement("td");
  let newCell3 = document.createElement("td");
  let newCell4 = document.createElement("td");
  newCell1.textContent = "1";
  newCell2.textContent = "Descripcion del articulo a agregar";
  newCell3.textContent = "$50000";
  newCell4.textContent = "$50000";
  newCell1.setAttribute("contenteditable", "true");
  newCell2.setAttribute("contenteditable", "true");
  newCell3.setAttribute("contenteditable", "true");
  newCell4.setAttribute("contenteditable", "true");
  newRow.appendChild(newCell1);
  newRow.appendChild(newCell2);
  newRow.appendChild(newCell3);
  newRow.appendChild(newCell4);

  return newRow;
}

function generarPDF() {
  let papers = document.querySelectorAll(".paper");
  let numero = document.querySelector(".numero").textContent;
  let pdf = new jsPDF("p", "mm", [210, 297]);
  let logo = logoConmenas();

  // Loop over each paper
  for (let i = 0; i < papers.length; i++) {
    html2canvas(papers[i], { backgroundColor: null, scale: 2 }).then(
      (canvas) => {
        let imgData = canvas.toDataURL("image/png");
        if (i !== 0) pdf.addPage();
        pdf.addImage(
          imgData,
          "PNG",
          0,
          0,
          pdf.internal.pageSize.width,
          pdf.internal.pageSize.height
        );
        if (i === 0) pdf.addImage(logo, "PNG", 165, 10, 30, 30);
        // Save the document
        if (i === papers.length - 1) {
          pdf.save("Factura-ConMenas-" + numero + ".pdf");
        }
      }
    );
  }
}

//click download
document.getElementById("btn-download-pdf").onclick = function () {
  generarPDF();
};

let page = 0;

document.getElementsByClassName("add")[0].onclick = function () {
  let paper = document.querySelectorAll(".paper")[page];
  let table = document.querySelectorAll(".table")[page];
  let subs = document.querySelector(".subs");
  let total = document.querySelector(".total");

  if (total.offsetTop + 100 > paper.offsetHeight) {
    let newElement = document.createElement("div");
    let main = document.querySelector("main");

    newElement.className = "paper";
    newElement.appendChild(total);
    main.appendChild(newElement);
  }
  if (subs.offsetTop + 100 > paper.offsetHeight) {
    let subs = document.querySelector(".subs");
    let nextPaper = document.querySelector("main").lastChild;

    nextPaper.insertBefore(subs, nextPaper.lastChild);

    page = page + 1;
  }

  if (table) {
    let tabletbody = table.querySelector("table tbody");
    tabletbody.appendChild(generarTR());
  } else {
    let newDiv = document.createElement("div");
    let newtable = document.createElement("table");
    let tbody = document.createElement("tbody");
    let add = document.querySelector(".add");
    newDiv.className = "table";
    newtable.appendChild(tbody);
    newDiv.appendChild(newtable);
    paper.insertBefore(newDiv, subs);
    newDiv.appendChild(add);
    tbody.appendChild(generarTR());
  }
};

document.getElementById("abono").onclick = function () {
  document.querySelector(".abono").classList.toggle("oculto");
};
document.getElementById("descuento").onclick = function () {
  document.querySelector(".descuento").classList.toggle("oculto");
};
